let word = "";

function GetCharacter(input){  
    if(("abcdefghijklmnopqrstuvwxyz").includes(input)){
        return ':regional_indicator_' + input + ":";
    }else{  
        switch (input) {
            case "0":
                return ':zero:'
                break;
            case "1":
                return ':one:'
                break;
            case "2":
                return ':two:'
                break;
            case "3":
                return ':three:'
                break;
            case "4":
                return ':four:'
                break;
            case "5":
                return ':five:'
                break;
            case "6":
                return ':six:'
                break;
            case "7":
                return ':seven:'
                break;
            case "8":
                return ':eight:'
                break;
            case "9":
                return ':nine:'
                break;
            case "!":
                return ':grey_exclamation:'
                break;
            case "<":
                return ':arrow_backward:'
                break;
            case ">":
                return ':arrow_forward:'
                break;
            case ",":
                return ','
                break;
            case ".":
                return '.'
                break;
            case "@":
                return '@'
                break;
            case "?":
                return ':question:'
                break;
            default:
                return ' ' 
                break;
        }
    }	
}

